const handleClick = e => {
   e.preventDefault();
   const confirmLogout = window.confirm('Czy na pewno chcesz się wylogować?');
   if (confirmLogout) {
     console.log('Użytkownik wylogowany.');

     // Kod do wylogowania użytkownika
   }
}


function Logout_X(){
    return(
       <div>
          <div className="EXIT">
                <button className="btn-1" id="logout" onClick={handleClick}>X</button>
            </div>
       </div>
    )
}



